import './App.css';
import Navbar from './components/navebar/Navbar';
import {Route,Routes} from 'react-router-dom'
import Home from './pages/Home/Home'
import Card from './pages/Card /Card'
function App() {
  return (
    <div className="App">
    <Navbar/>  
    <Routes>
    <Route path='/'element={<Home/>}></Route>
    </Routes>
    </div>
  );
}

export default App;
